INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('cecc3a65-98c9-42ca-b355-1ce9582d9b04', 'Healthequity', 'Invivo Partners is a venture capital firm specializing in early-stage healthcare companies, led by Luis Pareras, Albert Ferrer, and Laura Rodríguez. With investments in 15 portfolio companies and 3 successful exits, their portfolio companies have collectively raised over 350M€ from global VCs. The team at Invivo Partners combines scientific, technical, and financial expertise to make impactful investments and drive growth in the health sector. With a strong focus on Technology Transfer and market trends, the firm aims to establish itself as a key player in Europe''s biotech industry. Invivo Partners'' investor base includes major institutional investors such as the European Investment Fund, Instituto de Crédito Oficial (ICO), Institut Català de Finances (ICF), Institut Valencià de Finances (IVF), Barcelona City Council, alongside a majority of private investors. Initial investments typically range from 2-4M€, with follow-on investments up to 10M€ per company after achieving specified milestones. The firm specializes in pre-seed and seed investments, particularly in companies at the preclinical stage, and also participates in Series A investments for companies approximately 1-2 years away from First-in-Human trials. Invivo Partners focuses primarily on European-based opportunities, with a special emphasis on Spanish biotechnology companies developing innovative drugs, particularly in Advanced Therapies and Synthetic Biology.', 'http://healthequity.es/', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/healthequity-scr', '2025-12-25T18:32:14.456Z', 'com_b5b697c8-a349-4912-9b78-d7f2e5b20d4a', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:14.454Z', 'folk', '2025-12-25T18:32:14.456Z', 'Spain', 'Healthcare', '["info@healthequityventures.com"]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["https://healthequityventures.com"]'::jsonb, '{"Title":null,"Rounds":"Pre-Seed, Seed, Series A","Status":null,"Country":"Spain","Fund HQ":null,"VC Logo":null,"Website":"http://healthequity.es/","Linkedin":"https://www.linkedin.com/company/healthequity-scr","Country 1":"Spain","Country 2":null,"Last Name":null,"First Name":null,"HQ Location":"Spain","Funding Stage":"Series A/B","Investor Type":"VC Firm","Investor State":null,"Portfolio Link":"https://healthequityventures.com/search","Investment Size":"$100K – $500K","Investor''s Country":null,"Recent Investments":null,"Typical Investment":"€1.5M-€3M","Person Linkedin Url":null,"Num Lead Investments":null,"Partners'' LinkedIn Profile":null,"Total Number of Investments":null,"Partners'' LinkedIn Profile (2)":null,"Partners'' LinkedIn Profile (3)":null}'::jsonb, 'not_enriched') ON CONFLICT (id) DO UPDATE SET name = EXCLUDED.name, description = EXCLUDED.description, website = EXCLUDED.website, stages = EXCLUDED.stages, sectors = EXCLUDED.sectors, linkedin_url = EXCLUDED.linkedin_url, created_at = EXCLUDED.created_at, folk_id = EXCLUDED.folk_id, folk_workspace_id = EXCLUDED.folk_workspace_id, folk_list_ids = EXCLUDED.folk_list_ids, folk_updated_at = EXCLUDED.folk_updated_at, source = EXCLUDED.source, updated_at = EXCLUDED.updated_at, hq_location = EXCLUDED.hq_location, industry = EXCLUDED.industry, emails = EXCLUDED.emails, phones = EXCLUDED.phones, addresses = EXCLUDED.addresses, urls = EXCLUDED.urls, folk_custom_fields = EXCLUDED.folk_custom_fields, enrichment_status = EXCLUDED.enrichment_status;
