INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('eb01cbe4-4481-47c2-a667-afec3abdc128', 'Flybridge', 'VC firm backing ambitious founders leveraging the power of community. They believe that the first step is capital but beyond that, they leverage their own community to assist founders on every step of their journey, especially at the earliest stage. Flybridge is currently investing out of their two recently raised fund, totaling $150M.Flybridge has a straightforward and honest due diligence process that starts with a Phone/Zoom Convo With A Member of Our Investment Team, followed by Follow-ups with individual team members leading the opportunity and potentially 1-2 other investment team members, Due Diligence, Invitation to team meeting if it’s a good fit,Team discussion (internal), Pass/Offer, and then anInvestmentThey are committed to making daily, weekly, and monthly checkins focused on recruiting, product, fundraising, and leadership w/ founders they back.', 'http://www.flybridge.com', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/flybridge-capital-partners/', '2025-12-25T18:13:04.662Z', 'com_306574ce-319d-4a45-9eb3-61e8859b8c23', 'grp_8ae8dd89-d8de-419e-9697-01e42bf5a7a1', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_f2a9fb18-ee14-4467-b92f-a4854a8b7b7a","grp_8ae8dd89-d8de-419e-9697-01e42bf5a7a1","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:21:11.537Z', 'folk', '2025-12-25T18:21:11.537Z', 'United States', 'Generalist, Enterprise, AI, Logistics, Proptech, Cybersecurity, Future of Work', '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '{"Title":null,"Status":null,"Fund HQ":null,"Website":"http://www.flybridge.com","Linkedin":"https://www.linkedin.com/company/flybridge-capital-partne